import logo from './logo.svg';
import './App.css';
import Navbar from './Componentes/Navbar/Navbar';
import Footer from './Componentes/Footer/Footer';
import Home from './Componentes/Home/Home';


function App() {
  return (
    <>
    <Navbar />

    <div className="containerH">
        <section id="home">
          <Home />
        </section>

      </div>



    <Footer />

  </>
  );
}

export default App;
